import React from "react";

function SearchFunc(){

    return(
        <div className="tc">
            <h4 className="ma10 ">
                This Magic brain will detect the faces <br></br>in your pictures....give it a try..!
            </h4>
            <div>
                <input type="search"/>
            </div>
        </div>
    )
}


export default SearchFunc;
